import { Directive, EventEmitter, HostListener, Input, Output } from "@angular/core";
import { BarcodeScanner, ScanOptions } from "@capacitor-community/barcode-scanner";

@Directive({
  selector: "[barcode-scanner]",
  standalone: true
})
export class BarcodeScannerDirective {
  @Input("barcode-scanner")
  options: ScanOptions = {}

  @Output("scan") 
  scan = new EventEmitter<string>();

  @HostListener("click")
  async scanCode() {
    await BarcodeScanner.hideBackground();
    const res = await BarcodeScanner.startScan({ targetedFormats: [] });

    if (res.hasContent)
      this.scan.emit(res.content);
  }
}

import { Directive, EventEmitter, HostBinding, Input, Output } from "@angular/core";
import { Camera, ImageOptions } from "@capacitor/camera";
import { CameraResultType, Photo } from "@capacitor/camera/dist/esm/definitions";

@Directive({
  selector: "[camera]",
  standalone: true
})
export class CameraDirective {
  @Input("camera")
  options: ImageOptions = {
    resultType: CameraResultType.Base64
  };

  @Output()
  takePhoto = new EventEmitter<Photo>();

  @HostBinding("click")
  async take() {
    const photo = await Camera.getPhoto(this.options);
    this.takePhoto.emit(photo);
  }
}

