            type="tel" 
            clearInput>
          </ion-input>
        </ion-item>
      </ion-list>

      <ion-button 
        *rxLet="form.invalid$; let isInvalid" 
        [disabled]="isInvalid"
        (click)="submit()"
        [unpatch]
        expand="full">
        Submit
      </ion-button>
    </ion-content>
  `,
  standalone: true,
  changeDetection: ChangeDetectionStrategy.OnPush,
  imports: [
    IonicModule,
    ...importRxTemplate(),
    ReactiveFormsModule
  ]
})
export class RegistrationPage extends AngularComponent() {
  userStore = inject(UserStore);

  form = new FormGroup({
    token: new FormControl("", [
      Validators.required
    ]),
    pin: new FormControl("", [
      Validators.required,
      Validators.minLength(4)
    ])
  });

  submit = reaction(click$ => click$.pipe(
    this.takeUntilDestroyed(),
    clickReaction(),
    switchMap(() => this.userStore.getUserRequest$(this.form.value$))
  ));
}

